import{_ as l,c as e,a1 as i,o}from"./chunks/framework.CiOUwjDc.js";const t="/ko/labeling/intro-labeling.png",b=JSON.parse('{"title":"레이블링","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"guide/intro-labeling.md","filePath":"ko/guide/intro-labeling.md","lastUpdated":1745371375000}'),r={name:"guide/intro-labeling.md"};function n(d,a,h,c,s,u){return o(),e("div",null,a[0]||(a[0]=[i('<h1 id="레이블링" tabindex="-1">레이블링 <a class="header-anchor" href="#레이블링" aria-label="Permalink to &quot;레이블링&quot;">​</a></h1><p><img src="'+t+'" alt="레이블링"></p><h2 id="개요" tabindex="-1">개요 <a class="header-anchor" href="#개요" aria-label="Permalink to &quot;개요&quot;">​</a></h2><p>데이터셋에 포함된 이미지를 검색하고 어노테이션을 편집하는 도구를 제공합니다.</p><h2 id="화면-구성" tabindex="-1">화면 구성 <a class="header-anchor" href="#화면-구성" aria-label="Permalink to &quot;화면 구성&quot;">​</a></h2><h3 id="필터-영역" tabindex="-1">필터 영역 <a class="header-anchor" href="#필터-영역" aria-label="Permalink to &quot;필터 영역&quot;">​</a></h3><p>이미지 조회를 위한 필터가 표시됩니다.</p><h3 id="이미지-목록-영역" tabindex="-1">이미지 목록 영역 <a class="header-anchor" href="#이미지-목록-영역" aria-label="Permalink to &quot;이미지 목록 영역&quot;">​</a></h3><p>조회한 이미지 목록이 표시됩니다.</p><h3 id="캔버스-영역" tabindex="-1">캔버스 영역 <a class="header-anchor" href="#캔버스-영역" aria-label="Permalink to &quot;캔버스 영역&quot;">​</a></h3><p>이미지 목록에서 선택한 이미지 표시 및 레이블링 작업 진행됩니다.</p><ul><li>이미지 메타 데이터 확인<br> 캔버스 영역에 있는 <code>이미지 메타</code> 플로팅 버튼을 클릭하면 선택한 이미지의 메타 데이터를 확인할 수 있습니다.</li><li>툴 박스 <ul><li>선택 : 이미지 또는 어노테이션 선택할 수 있습니다.</li><li>삭제 : 선택한 어노테이션을 삭제할 수 있습니다.</li><li>RC 유형 변경 : RC 타입 어노테이션의 유형을 변경할 수 있습니다.</li><li>회전 도구 : 이미지 또는 어노테이션을 왼쪽 또는 오른쪽으로 회전합니다. <ul><li>이미지 회전 : 선택한 어노테이션이 없는 경우 이미지를 90도 만큼 회전합니다.</li><li>어노테이션 회전 : 어노테이션이 선택된 경우 어노테이션을 10도 만큼 회전합니다.</li></ul></li><li>그리기 도구 : <code>사각형</code>, <code>다각형</code>, <code>붓</code> 도구를 사용하여 어노테이션을 작성할 수 있습니다.</li><li>클립보드 보기 : 복사한 어노테이션을 표시합니다.</li><li>ROI 영역 보기 : ROI 영역을 표시합니다.</li><li>결함 영역 보기 : 결함 영역을 표시합니다.</li><li>표시 이미지 선택 : 캔버스에 표시할 이미지를 선택합니다. (<code>원본</code>, <code>X-Ray</code>, <code>...</code>)</li></ul></li><li>이전 : 이전 이미지를 표시합니다.</li><li>다음 : 다음 이미지를 표시합니다.</li><li>확장/원복 : 캔버스 영역을 확장하거나 확장한 캔버스 영역을 축소합니다.</li><li>추론 : 선택한 이미지에 선택한 모델을 이용한 추론한 영역과 값을 표시합니다.</li></ul><h3 id="어노테이션-타입-목록-영역" tabindex="-1">어노테이션 타입 목록 영역 <a class="header-anchor" href="#어노테이션-타입-목록-영역" aria-label="Permalink to &quot;어노테이션 타입 목록 영역&quot;">​</a></h3><p>이미지 목록에서 선택한 이미지에서 사용할 수 있는 어노테이션 타입 목록이 표시됩니다.</p><h2 id="기능" tabindex="-1">기능 <a class="header-anchor" href="#기능" aria-label="Permalink to &quot;기능&quot;">​</a></h2><ul><li>이미지 조회</li><li>레이블링</li></ul><h2 id="다음-단계는" tabindex="-1">다음 단계는? <a class="header-anchor" href="#다음-단계는" aria-label="Permalink to &quot;다음 단계는?&quot;">​</a></h2><ul><li>레이블링 작업을 완료했다면, <a href="./intro-training-validation">학습 및 검증</a> 기능에 대해 알아보겠습니다.</li></ul>',18)]))}const m=l(r,[["render",n]]);export{b as __pageData,m as default};
